import { useState,useEffect } from 'react';
import axios from 'axios';

const App = () => {

    const [data,setData] = useState([]);
    let products= [];

    
    const datas=()=>{
        axios.get('http://localhost:5000/product/getAllProducts').then(res=>{
            products = res.data;
            setData(products);
        }).catch(err=>{
            console.log(err);
        })
    }

    useEffect(()=>{
        datas();
    },[data])
  return (
    <div>
        {
            data.map(pro=>{
                <p>{pro.pname}</p>
            })
        }
    </div>
  )
}

export default App
